import React from "react";
import ReactDOM from "react-dom";
import "./grid.css";
import NavBar from "./components/NavBar";
import "./App.css";
import Greeting from "./components/Greeting";
import PortContentList from "./components/PortContentList";
import AboutMe from "./components/AboutMe";
import CommentList from "./components/CommentList";
import Header from "./components/Header";
import SkillList from "./components/SkillList";
import Contact from "./components/Contact";
import "./fonts/BungeeInline-Regular.ttf";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      navBar: ["INTRODUCTION", "PRODUCTS", "SKILLS", "ABOUT ME", "CONTACT"],
      linkContent: [
        "Posters",
        "Prizes",
        "Projects",
        "Event Managing",
        "Social Contents",
      ],
    };
  }

  render() {
    return (
      <div className="body">
        <div className="main-background"> </div>
        <div className="cover">
          <NavBar content={this.state.navBar} />
          <Greeting />
        </div>

        <div className="content">
          <div className="portfolio">
            <Header title="Sản phẩm " titleEmph="đã từng thực hiện" />
            <NavBar content={this.state.linkContent} />
            <PortContentList />
          </div>
          <div className="my-skill">
            <Header title="Kỹ năng" titleEmph="cá nhân" />
            <SkillList />
          </div>

          <div className="about-me">
            <AboutMe />
          </div>

          <div className="comment">
            <Header
              title="Nhận xét từ "
              titleEmph="khách hàng và cựu đồng nghiệp"
            />
            <CommentList />
          </div>

          <div className="contact">
            <Header title="Kết nối " titleEmph="với tôi" />
            <Contact />
          </div>
        </div>
      </div>
    );
  }
}
export default App;
